import React, {useEffect} from 'react';
import {useParams} from 'react-router-dom'
import Presentation from './Presentation'
import Footer from './Footer'
const DetailVoiture = () => {
    const {id} = useParams()
    return (
        <div>
         <Presentation/>
            <h1> DetailVoiture {id} </h1>
            <Footer/>
        </div>
    );
};

export default DetailVoiture;
